//Home Button

import React from 'react'
import styled from 'styled-components'

const Power = styled.button`
position: fixed;
top: 2rem;
left: 50%;
transform: translate(-50%, 0);

background-color: #4831D4;
padding: 0.3rem;
border-radius: 50%;
`

const PowerButton = () => {
  return (
    <Power>
        Home
    </Power>
  )
}

export default PowerButton
